 import {routeList} from '@/datas/menucode.js'
//后台返回公共路由循环
let routeFilter = routeList.filter(item => item.path != null)
const allRoutePath = routeFilter.map(item => {
    let component = item.path;
    if(item.component){
        component = item.component
    }
    return {
        path: item.path,
        name: item.name,
        component: resolve => require(['@/views' + component], resolve),
        meta: {
            requireAuth: (item.auth == null || item.auth == undefined) ? true : item.auth,
            title:item.name,
            topBar:(item.topBar == null || item.topBar == undefined)?false:true,
            backBtn:false,
            icon:item.icon,
            currentid:item.id
        },
    }
});
export default [{
    path: '/',
    name: '',
    component: resolve => require(["@/views/login"], resolve),
    hidden: true,
    meta: {
        requireAuth: false
    }
}, {
    path: '/login',
    name: 'login',
    component: resolve => require(["@/views/login"], resolve),
    hidden: true,
    meta: {
        requireAuth: false,
    }
}, {
    path: '/index',
    name: 'private_policy.html',
    component: resolve => require(["@/views/index"], resolve),
    iconCls: 'el-icon-tickets',
    children: allRoutePath
}
]
